pragma solidity =0.6.6;
pragma experimental ABIEncoderV2;

import "./interfaces/IBorrowable.sol";
import "./interfaces/ICollateral.sol";
import "./interfaces/IImpermaxCallee.sol";
import "./interfaces/IERC20.sol";
import "./interfaces/IWETH.sol";
import "./interfaces/IUniswapV2Pair.sol";
import "./interfaces/IStakedLPToken01.sol";
import "./libraries/Math.sol";
import "./libraries/SafeMath.sol";
import "./libraries/TransferHelper.sol";
import "./libraries/UniswapV2Library.sol";

// This assumes that the borrower has enough collateral to repay
// The chance that this is not true is low and the check isn't worth the additional gas cost
// The check should be done off chain, and the caller should use the right liquidateAmount parameter
// Another problem is the slippage, so it may be convenient to liquidate large amounts in multiple rounds

contract CapitalFreeLiquidate04 is IImpermaxCallee {
	using SafeMath for uint;

	address public immutable factory;
	address public immutable bDeployer;
	address public immutable cDeployer;
	address public immutable WETH;
	
	address public to;

	constructor(address _factory, address _bDeployer, address _cDeployer, address _WETH, address _to) public {
		factory = _factory;
		bDeployer = _bDeployer;
		cDeployer = _cDeployer;
		WETH = _WETH;
		to = _to;
	}

	receive() external payable {
		assert(msg.sender == WETH); // only accept ETH via fallback from the WETH contract
	}
	
	function _burn(
		address underlying, 
		address uniswapV2Pair, 
		address recipient,
		uint collateralToBurn
	) internal virtual returns (uint amount0, uint amount1) {
		IUniswapV2Pair(underlying).transfer(underlying, collateralToBurn);
		if (isStakedLPToken(underlying)) IStakedLPToken01(underlying).redeem(uniswapV2Pair);
		(amount0, amount1) = IUniswapV2Pair(uniswapV2Pair).burn(recipient);
	}
	
	function _swap(
		address uniswapV2Pair,
		address tokenA, 
		address tokenB,
		uint amountA,
		uint amountB,
		uint liquidateAmountA, 
		uint liquidateAmountB 
	) internal virtual {
		address tokenIn = amountA > liquidateAmountA ? tokenA: tokenB;
		uint swapAmountIn = amountA > liquidateAmountA ? 
			amountA.sub(liquidateAmountA) : 
			amountB.sub(liquidateAmountB, "CapitalFreeLiquidate: INSUFFICIENTS_AVAILABLE_AMOUNTS");
		uint swapAmountOut = amountA < liquidateAmountA ? liquidateAmountA.sub(amountA) :
			amountB < liquidateAmountB ? liquidateAmountB.sub(amountB) : 0;
		if (swapAmountOut == 0) return;
		TransferHelper.safeTransfer(tokenIn, uniswapV2Pair, swapAmountIn);
		(uint amount0Out, uint amount1Out) = tokenA == tokenIn ? (uint(0), swapAmountOut) : (swapAmountOut, uint(0));
		IUniswapV2Pair(uniswapV2Pair).swap(amount0Out, amount1Out, address(this), new bytes(0));
	}
	
	function _liquidate(
		address borrowable,
		address token,
		uint liquidateAmount,
		address borrower, 
		address collateral
	) internal virtual {
		if (liquidateAmount > 0) {
			TransferHelper.safeTransfer(token, borrowable, liquidateAmount);
			IBorrowable(borrowable).liquidate(borrower, collateral);
		}
	}
	
	function _borrowBalance(
		address borrowable,
		address borrower
	) internal virtual returns (uint amount) {
		IBorrowable(borrowable).accrueInterest();
		amount = IBorrowable(borrowable).borrowBalance(borrower);
	}
	
	function _setupAmounts(
		address underlying,
		address borrower
	) internal virtual returns (uint liquidateAmountA, uint liquidateAmountB, uint collateralAmount) {
		address collateral = getCollateral(underlying);
		uint priceA; uint priceB;
		uint liquidationIncentive;
		uint collateralAmountA;
		uint collateralAmountB;
		{
		(, address borrowableA, address borrowableB) = getLendingPool(underlying);
		uint borrowBalanceA = _borrowBalance(borrowableA, borrower);
		uint borrowBalanceB = _borrowBalance(borrowableB, borrower);
		(priceA, priceB) = ICollateral(collateral).getPrices();
		liquidationIncentive = ICollateral(collateral).liquidationIncentive();
		collateralAmountA = borrowBalanceA.mul(liquidationIncentive).div(1e18).mul(priceA).div(1e18) * 9999 / 10000;
		collateralAmountB = borrowBalanceB.mul(liquidationIncentive).div(1e18).mul(priceB).div(1e18) * 9999 / 10000;
		}
		// Avoid liquidating too much
		uint collateralAvailable = ICollateral(collateral).balanceOf(borrower).mul(9999) / 10000;
		collateralAvailable = collateralAvailable.mul(ICollateral(collateral).exchangeRate()).div(1e18);
		if (collateralAmountA.add(collateralAmountB) > collateralAvailable) {
			uint collateralAmountMin = Math.min(collateralAmountA, collateralAmountB);
			uint collateralAmountMax = Math.max(collateralAmountA, collateralAmountB);
			if (collateralAmountMin > collateralAvailable) {
				collateralAmountMin = collateralAvailable;
				collateralAmountMax = 0;
			} else {
				collateralAmountMax = collateralAvailable - collateralAmountMin;
			}
			(collateralAmountA, collateralAmountB) = collateralAmountA < collateralAmountB ? (collateralAmountMin, collateralAmountMax) : (collateralAmountMax, collateralAmountMin);
		}
		liquidateAmountA = collateralAmountA.mul(1e18).div(liquidationIncentive).mul(1e18).div(priceA) * 10000 / 9999;
		liquidateAmountB = collateralAmountB.mul(1e18).div(liquidationIncentive).mul(1e18).div(priceB) * 10000 / 9999;
		collateralAmount = collateralAmountA.add(collateralAmountB);
		require(collateralAmount > 0, "CapitalFreeLiquidate: ZERO_COLLATERAL_AMOUNT (frontrun)");
	}
	
	function _collateralToBurn(
		address underlying,
		uint liquidateAmountA,
		uint liquidateAmountB
	) internal virtual returns (uint collateralToBurn) {
		uint totalSupply;
		uint liqIn; uint liqOut;
		uint resIn; uint resOut;
		{
		address uniswapV2Pair = getUniswapV2Pair(underlying);
		totalSupply = IUniswapV2Pair(uniswapV2Pair).totalSupply();
		(uint reserveA, uint reserveB,) = IUniswapV2Pair(uniswapV2Pair).getReserves();
		(liqIn, liqOut, resIn, resOut) = liquidateAmountA.mul(1e18).div(reserveA) > liquidateAmountB.mul(1e18).div(reserveB)
			? (liquidateAmountB, liquidateAmountA, reserveB, reserveA)
			: (liquidateAmountA, liquidateAmountB, reserveA, reserveB);
		}
		uint a = resIn.mul(resOut);
		uint nb = resIn.mul(resOut).mul(1997).div(1000).add(resIn.mul(liqOut).mul(3).div(1000));
		uint c = resIn.mul(liqOut).add(resOut.mul(liqIn).mul(997).div(1000)).sub(liqOut.mul(liqIn).mul(997).div(1000));
		uint rad = Math.sqrt((nb/2e20).mul(nb/2e20).sub((a/2e20).mul(c/2e20).mul(4))) * 2e20;
		uint x = nb.sub(rad, "proprio quello").mul(1e18).div(a.mul(2));
		collateralToBurn = totalSupply.mul(x).div(1e18) * 10000 / 9999;
		if (isStakedLPToken(underlying)) {
			collateralToBurn = collateralToBurn.mul(1e18).div(IStakedLPToken01(underlying).exchangeRate());
		}
	}
	
	function liquidate(
		address underlying,
		address borrower,
		uint profitMin
	) external virtual returns (uint profit) {
		(address collateral, address borrowableA, address borrowableB) = getLendingPool(underlying);
		(uint liquidateAmountA, uint liquidateAmountB, uint collateralAmount) = _setupAmounts(underlying, borrower);
		uint collateralToBurn = _collateralToBurn(underlying, liquidateAmountA, liquidateAmountB);
		profit = collateralAmount.sub(collateralToBurn, "CapitalFreeLiquidator: NEGATIVE_PROFIT");
		require(profit >= profitMin, "CapitalFreeLiquidator: INSUFFICIENT_PROFIT");
		bytes memory data = abi.encode(CalleeData({
			underlying: underlying,
			borrower: borrower,
			collateral: collateral,
			borrowableA: borrowableA,
			borrowableB: borrowableB,
			liquidateAmountA: liquidateAmountA,
			liquidateAmountB: liquidateAmountB,
			collateralAmount: collateralAmount,
			collateralToBurn: collateralToBurn
		}));
		ICollateral(collateral).flashRedeem(address(this), collateralAmount, data);
		//IUniswapV2Pair(underlying).transfer(collateral, collateralAmount.sub(collateralToBurn));
		//ICollateral(collateral).mint(to);
	}
	
	function liquidateDebug(
		address underlying,
		address borrower,
		uint profitMin
	) external virtual returns (uint liquidateAmountA, uint liquidateAmountB, uint collateralAmount, uint collateralToBurn) {
		profitMin;
		(liquidateAmountA, liquidateAmountB, collateralAmount) = _setupAmounts(underlying, borrower);
		collateralToBurn = _collateralToBurn(underlying, liquidateAmountA, liquidateAmountB);
	}
	
	function liquidateDebug2(
		address underlying,
		address borrower,
		uint profitMin
	) external virtual returns (uint profit) {
		(address collateral, address borrowableA, address borrowableB) = getLendingPool(underlying);
		(uint liquidateAmountA, uint liquidateAmountB, uint collateralAmount) = _setupAmounts(underlying, borrower);
		uint collateralToBurn = _collateralToBurn(underlying, liquidateAmountA, liquidateAmountB);
		profit = collateralAmount.sub(collateralToBurn, "CapitalFreeLiquidator: NEGATIVE_PROFIT");
		require(profit >= profitMin, "CapitalFreeLiquidator: INSUFFICIENT_PROFIT");
		bytes memory data = abi.encode(CalleeData({
			underlying: underlying,
			borrower: borrower,
			collateral: collateral,
			borrowableA: borrowableA,
			borrowableB: borrowableB,
			liquidateAmountA: liquidateAmountA,
			liquidateAmountB: liquidateAmountB,
			collateralAmount: collateralAmount,
			collateralToBurn: collateralToBurn
		}));
	}
	
	function liquidateCallback(
		address underlying,
		address borrower,
		address collateral,
		address borrowableA,
		address borrowableB,
		uint liquidateAmountA,
		uint liquidateAmountB,
		uint collateralAmount,
		uint collateralToBurn
	) internal virtual {
		address uniswapV2Pair = getUniswapV2Pair(underlying);
		address tokenA = IUniswapV2Pair(underlying).token0();
		address tokenB = IUniswapV2Pair(underlying).token1();
		uint amountA;
		{
		uint amountB;
		(amountA, amountB) = _burn(underlying, uniswapV2Pair, address(this), collateralToBurn);
		_swap(uniswapV2Pair, tokenA, tokenB, amountA, amountB, liquidateAmountA, liquidateAmountB);
		}
		if (liquidateAmountA < amountA) {
			_liquidate(borrowableA, tokenA, liquidateAmountA, borrower, collateral);
			_liquidate(borrowableB, tokenB, liquidateAmountB, borrower, collateral);
		} else {
			_liquidate(borrowableB, tokenB, liquidateAmountB, borrower, collateral);		
			_liquidate(borrowableA, tokenA, liquidateAmountA, borrower, collateral);
		}
		_burn(underlying, uniswapV2Pair, to, collateralAmount.sub(collateralToBurn));
	}
	
	struct CalleeData {
		address underlying;
		address borrower;
		address collateral;
		address borrowableA;
		address borrowableB;
		uint liquidateAmountA;
		uint liquidateAmountB;
		uint collateralAmount;
		uint collateralToBurn;
	}
	
	function impermaxRedeem(address sender, uint redeemAmount, bytes calldata data) external virtual override {
		sender; redeemAmount;
		// no security check needed
		CalleeData memory calleeData = abi.decode(data, (CalleeData));
		liquidateCallback(
			calleeData.underlying,
			calleeData.borrower,
			calleeData.collateral,
			calleeData.borrowableA,
			calleeData.borrowableB,
			calleeData.liquidateAmountA,
			calleeData.liquidateAmountB,
			calleeData.collateralAmount,
			calleeData.collateralToBurn
		);
	}

	function impermaxBorrow(address sender, address borrower, uint borrowAmount, bytes calldata data) external virtual override { sender; borrower; borrowAmount; data; }
	
	/*** UTILITIES ***/
	
	function isStakedLPToken(address underlying) public virtual view returns(bool) {
		try IStakedLPToken01(underlying).isStakedLPToken() returns (bool result) {
			return result;
		} catch {
			return false;
		}
	}
	function getUniswapV2Pair(address underlying) public virtual view returns (address) {
		try IStakedLPToken01(underlying).underlying() returns (address u) {
			if (u != address(0)) return u;
			return underlying;
		} catch {
			return underlying;
		}
	}
	
	function getBorrowable(address underlying, uint8 index) public virtual view returns (address borrowable) {
		require(index < 2, "CapitalFreeLiquidator: INDEX_TOO_HIGH");
		borrowable = address(uint(keccak256(abi.encodePacked(
			hex"ff",
			bDeployer,
			keccak256(abi.encodePacked(factory, underlying, index)),
			hex"605ba1db56496978613939baf0ae31dccceea3f5ca53dfaa76512bc880d7bb8f" // Borrowable bytecode keccak256
		))));
	}
	function getCollateral(address underlying) public virtual view returns (address collateral) {
		collateral = address(uint(keccak256(abi.encodePacked(
			hex"ff",
			cDeployer,
			keccak256(abi.encodePacked(factory, underlying)),
			hex"4b8788d8761647e6330407671d3c6c80afaed3d047800dba0e0e3befde047767" // Collateral bytecode keccak256
		))));
	}
	function getLendingPool(address underlying) public virtual view returns (address collateral, address borrowableA, address borrowableB) {
		collateral = getCollateral(underlying);
		borrowableA = getBorrowable(underlying, 0);
		borrowableB = getBorrowable(underlying, 1);
	}
}
